import { Link } from "react-router-dom";

export const MenuItems = (props) => {
   const content = (
      <ul>
         {
            props.map((props) =>
               <li><Link key={props.length()} className="linkSidebar" to={props.url}>
                  {props.value}
               </Link>
               </li>

               
            )
         }
      </ul>

   );
   return (

      <div>
         {content}
      </div>
      );
    
};
